import React from "react";

export const Card = (props) => {
  return (
    <div className="card-container">
      <img
        alt="cat"
        src={`https://robohash.org/${props.kediler.id}?set=set4&size=180x180`}
      ></img>
      <h1> {props.name} </h1>
      <p> {props.email} </p>
      <p> {props.catchPhrase} </p>
    </div>
  );
};
